(1001, 'Photography Wiki', '<p>"Photographic" redirects here. For the image obtained, see Photograph. For other uses, see Photography (disambiguation).\r\n\r\nLens and mounting of a large-format camera\r\nPhotography\r\nOther names	Science or Art of creating durable images\r\nTypes	Recording or other electromagnetic radiation Electronically or Chemically\r\nInventor	Thomas Wedgwood (1800)\r\nRelated	Stereoscopic, Full-spectrum, Light field, Electrophotography, Photograms, Scanner\r\nPhotography is the science, art and practice of creating durable images by recording light or other electromagnetic radiation, either electronically by means of an image sensor, or chemically by means of a light-sensitive material such as photographic film.[1]\r\n\r\nTypically, a lens is used to focus the light reflected or emitted from objects into a real image on the light-sensitive surface inside a camera during a timed exposure. With an electronic image sensor, this produces an electrical charge at each pixel, which is electronically processed and stored in a digital image file for subsequent display or processing. The result with photographic emulsion is an invisible latent image, which is later chemically "developed" into a visible image, either negative or positive depending on the purpose of the photographic material and the method of processing. A negative image on film is traditionally used to photographically create a positive image on a paper base, known as a print, either by using an enlarger or by contact printing.\r\n\r\nPhotography is employed in many fields of science, manufacturing (e.g., photolithography) and business, as well as its more direct uses for art, film and video production, recreational purposes, hobby, and mass communication.</p>', , 'Wikipedia', '2016-05-23 11:16:24');
